import { useState } from "react";


const NewCounter = () => {

  const [left, setLeft] = useState(10)
  const [right, setRight] = useState(20)

  return (
    <div>
      {left}
      <button onClick={() => setLeft(left + 1)}>left</button>
      <button onClick={() => setRight(right + 1)}>right</button>
      {right}
    </div>
  );
}

export default NewCounter
